                if(userCanvas) userCanvas.style.display = 'none'; 
                const foundZones = new Set(); 
                const scaleX = imageEl.naturalWidth / imageEl.clientWidth; 
                const scaleY = imageEl.naturalHeight / imageEl.clientHeight; 
                currentCase.zonesErreur.forEach(zoneErreur => { 
                    for (const guess of userGuesses) { 
                        const guessBounds = getBoundsFromPoints(guess.points || [{x:guess.x, y:guess.y}, {x:guess.x+guess.width, y:guess.y+guess.height}]); 
                        const guessCenterX = (guessBounds.minX + guessBounds.width / 2) * scaleX; 
                        const guessCenterY = (guessBounds.minY + guessBounds.height / 2) * scaleY; 
                        if(isPointInObject({x: guessCenterX, y: guessCenterY}, zoneErreur)) { 
                            foundZones.add(zoneErreur); 
                            break; 
                        } 
                    } 
                }); 
                const ctx = setupSolutionCanvas(); 
                feedbackEl.innerHTML = `<h3>Correction : ${foundZones.size} / ${currentCase.zonesErreur.length} erreurs trouv√©es</h3><p>Cliquez sur chaque zone pour voir les d√©tails.</p>`; 
                currentCase.zonesErreur.forEach(zoneErreur => { 
                    const isFound = foundZones.has(zoneErreur); 
                    drawObject(ctx, zoneErreur, isFound ? 'reussite' : 'erreur'); 
                }); 
                drawAnnotationsAndZones(ctx, [], currentCase.annotationsErreur, 'erreur'); 
                
                console.log('V√©rification des boutons √† afficher:');
                console.log('  - imageCorrecteSrc:', currentCase.imageCorrecteSrc ? 'OUI' : 'NON');
                console.log('  - imageReferenceSrc:', currentCase.imageReferenceSrc ? 'OUI' : 'NON');
                
                if (currentCase.imageCorrecteSrc || currentCase.imageReferenceSrc) { 
                    reussiteBtn.style.display = 'inline-block';
                    console.log('  -> Bouton Crit√®res affich√©');
                }
                if (currentCase.imageReferenceSrc) { 
                    referenceBtn.style.display = 'inline-block';
                    console.log('  -> Bouton R√©f√©rence affich√©');
                }
            }
            function handleSolutionClick(event) { const rect = solutionCanvas.getBoundingClientRect(); const scaleX = imageEl.naturalWidth / rect.width; const scaleY = imageEl.naturalHeight / rect.height; const pos = { x: (event.clientX - rect.left) * scaleX, y: (event.clientY - rect.top) * scaleY }; let clickedZone = null; const isErrorMode = !imageEl.src.endsWith(currentCase.imageCorrecteSrc) && !imageEl.src.endsWith(currentCase.imageReferenceSrc); const zonesToCheck = isErrorMode ? currentCase.zonesErreur : currentCase.zonesReussite; for(const zone of zonesToCheck) { if(isPointInObject(pos, zone)) { clickedZone = zone; break; } } if (clickedZone) { const popup = document.getElementById('popup'); document.getElementById('popup-content').innerHTML = clickedZone.explication || clickedZone.critere; popup.style.display = 'flex'; } }
            function setupSolutionCanvas() { if(solutionCanvas) { containerEl.querySelectorAll('div[data-id]').forEach(el => el.remove()); solutionCanvas.getContext('2d').clearRect(0,0,solutionCanvas.width, solutionCanvas.height); solutionCanvas.removeEventListener('click', handleSolutionClick); } else { solutionCanvas = document.createElement('canvas'); solutionCanvas.style.position = 'absolute'; solutionCanvas.style.top = '0'; solutionCanvas.style.left = '0'; containerEl.appendChild(solutionCanvas); } solutionCanvas.width = imageEl.naturalWidth; solutionCanvas.height = imageEl.naturalHeight; solutionCanvas.style.width = '100%'; solutionCanvas.style.height = '100%'; solutionCanvas.style.cursor = 'pointer'; solutionCanvas.addEventListener('click', handleSolutionClick); return solutionCanvas.getContext('2d'); }
            function montrerSolutionErreurs() { 
                const ctx = setupSolutionCanvas(); 
                drawAnnotationsAndZones(ctx, currentCase.zonesErreur, currentCase.annotationsErreur, 'erreur'); 
                
                if (currentCase.imageCorrecteSrc || currentCase.imageReferenceSrc) { 
                    reussiteBtn.style.display = 'inline-block';
                }
                if (currentCase.imageReferenceSrc) { 
                    referenceBtn.style.display = 'inline-block';
                }
            }
            window.choixCorrecte = function() { 
                choixEl.style.display = 'none'; 
                if (currentCase.zonesErreur.length === 0) { 
                    feedbackEl.textContent = "CORRECT ! Cette image ne comporte pas d'erreur."; 
                    if (currentCase.imageCorrecteSrc || currentCase.imageReferenceSrc) { 
                        reussiteBtn.style.display = 'inline-block';
                    }
                    if (currentCase.imageReferenceSrc) { 
                        referenceBtn.style.display = 'inline-block';
                    }
                } else { 
                    feedbackEl.textContent = "INCORRECT. Cette image comporte des erreurs. Voici la solution :"; 
                    montrerSolutionErreurs(); 
                } 
            }
            window.voirReussite = function() {
                console.log('=== Voir R√©ussite cliqu√© ===');
                console.log('imageCorrecteSrc:', currentCase.imageCorrecteSrc ? 'OUI' : 'NON');
                console.log('imageReferenceSrc:', currentCase.imageReferenceSrc ? 'OUI' : 'NON');
                
                reussiteBtn.style.display = 'none'; 
                
                const imageToShow = currentCase.imageCorrecteSrc || currentCase.imageReferenceSrc;
                
                if (imageToShow) {
                    feedbackEl.textContent = "Voici le clich√© correct avec les crit√®res de r√©ussite."; 
                    imageEl.src = imageToShow; 
                    imageEl.onload = () => { 
                        const ctx = setupSolutionCanvas(); 
                        drawAnnotationsAndZones(ctx, currentCase.zonesReussite, currentCase.annotationsReussite, 'reussite'); 
                    };
                } else {
                    feedbackEl.textContent = "Aucune image correcte disponible.";
                    console.error('Aucune image correcte trouv√©e!');
                }
            }
            window.voirReference = function() {
                console.log('=== Voir R√©f√©rence cliqu√© ===');
                console.log('imageReferenceSrc:', currentCase.imageReferenceSrc);
                
                if (currentCase && currentCase.imageReferenceSrc) { 
                    const popup = document.getElementById('popup');
                    const img = new Image();
                    img.onload = function() {
                        const canvasRef = document.createElement('canvas');
                        canvasRef.width = img.width;
                        canvasRef.height = img.height;
                        canvasRef.style.maxWidth = '100%';
                        canvasRef.style.maxHeight = '70vh';
                        canvasRef.style.border = '2px solid #555';
                        const ctxRef = canvasRef.getContext('2d');
                        
                        let showCriteria = true;
                        
                        function drawReferenceImage() {
                            ctxRef.clearRect(0, 0, canvasRef.width, canvasRef.height);
                            ctxRef.drawImage(img, 0, 0);
                            
                            if (showCriteria && currentCase.zonesReussite) {
                                currentCase.zonesReussite.forEach(zone => {
                                    drawObject(ctxRef, zone, 'reussite');
                                });
                            }
                            if (showCriteria && currentCase.annotationsReussite) {
                                currentCase.annotationsReussite.forEach(ann => {
                                    drawObject(ctxRef, ann, 'reussite');
                                });
                            }
                        }
                        
                        drawReferenceImage();
                        
                        const toggleBtn = document.createElement('button');
                        toggleBtn.textContent = 'üëÅÔ∏è Masquer les crit√®res';
                        toggleBtn.style.marginTop = '15px';
                        toggleBtn.style.padding = '10px 20px';
                        toggleBtn.style.fontSize = '14px';
                        toggleBtn.onclick = function() {
                            showCriteria = !showCriteria;
                            toggleBtn.textContent = showCriteria ? 'üëÅÔ∏è Masquer les crit√®res' : 'üëÅÔ∏è Afficher les crit√®res';
                            drawReferenceImage();
                        };
                        
                        document.getElementById('popup-content').innerHTML = '<h3 style="margin-top:0;">Image de R√©f√©rence</h3>';
                        document.getElementById('popup-content').appendChild(canvasRef);
                        document.getElementById('popup-content').appendChild(toggleBtn);
                        popup.style.display = 'flex';
                    };
                    img.src = currentCase.imageReferenceSrc;
                } else {
                    console.error('Aucune image de r√©f√©rence trouv√©e!');
                    alert('Aucune image de r√©f√©rence disponible pour ce cas.');
                }
            }
            function drawAnnotationsAndZones(ctx, zones, annotations, mode) { [...zones, ...annotations].forEach(obj => { if (obj.masquable) { drawEye(obj.id); } else { drawObject(ctx, obj, mode); } }); }
            function getObjectCenter(obj) { if (obj.type === 'arrow') return { x: (obj.startX + obj.endX)/2, y: (obj.startY + obj.endY)/2 }; if (obj.type === 'text') return { x: obj.x, y: obj.y - obj.size / 2}; if (obj.type === 'oval') return { x: obj.x + obj.width/2, y: obj.y + obj.height/2 }; if (obj.points) return { x: obj.x + obj.width/2, y: obj.y + obj.height/2 }; return { x: obj.x + obj.width / 2, y: obj.y + obj.height/2 }; }
            function drawEye(id) { const allObjects = [...currentCase.zonesErreur, ...currentCase.annotationsErreur, ...currentCase.zonesReussite, ...currentCase.annotationsReussite]; const obj = allObjects.find(o => o.id === id); if (!obj) return; const center = getObjectCenter(obj); const eyeEl = document.createElement('div'); eyeEl.textContent = 'üëÅÔ∏è'; eyeEl.style.position = 'absolute'; eyeEl.style.left = `${(center.x / imageEl.naturalWidth * 100)}%`; eyeEl.style.top = `${(center.y / imageEl.naturalHeight * 100)}%`; eyeEl.style.transform = 'translate(-50%, -50%)'; eyeEl.style.fontSize = '24px'; eyeEl.style.cursor = 'pointer'; eyeEl.style.textShadow = '0 0 5px black'; eyeEl.setAttribute('data-id', id); eyeEl.onclick = (e) => { e.target.style.display = 'none'; const isErrorMode = !imageEl.src.endsWith(currentCase.imageCorrecteSrc) && !imageEl.src.endsWith(currentCase.imageReferenceSrc); const dataSet = isErrorMode ? [...currentCase.zonesErreur, ...currentCase.annotationsErreur] : [...currentCase.zonesReussite, ...currentCase.annotationsReussite]; const objToShow = dataSet.find(o => o.id === parseInt(e.target.getAttribute('data-id'))); if(objToShow) drawObject(solutionCanvas.getContext('2d'), objToShow, isErrorMode ? 'erreur' : 'reussite'); }; containerEl.appendChild(eyeEl); }
            </script></body></html>
